import React from "react";
import './Admin.css';
import '../bootstrap/bootstrap.css';
import logo from './image/logo.jpg';

export function Admin() {
    return (
        <>
          <div className="PageContain">
            <div className="Nav">
              <nav class="navbar navbar-expand-sm bg-light navbar-light">
                <div className="logo"><img src={logo} className="logo"/></div>
                <div className="btn2"><button type="btn" className="btn btn-outline-primary">Log out</button></div>
              </nav>
            </div>
            <div className="menu">
            <table className="table-striped rounded-2 shadow text-center tab">
				<tr><td className="p-2">Planning</td></tr>
                <tr><td className="p-2">Add new meet</td></tr>
                <tr><td className="p-2">Settings</td></tr>
            </table>
            </div>
          </div>
        </>
    )
}
